(ns advent-of-code.day5-polymer-reduction
  (:require [clojure.string :as str]))

(def input "")
;(def input "dabAcCaCBAcCcaDA")

(defn reduce-polymer [input]
  (->> input
       (reduce (fn [result char-b]
                 ;(println result char-b)
                 (if (empty? result)
                   (str char-b)
                   (let [char-a (last result)]
                     (if (and (not= char-a char-b)
                              (= (str/lower-case char-a) (str/lower-case char-b)))
                       (str/join (drop-last result))
                       (str result char-b)))))
               [])
       (apply str)))

(comment (count input))

(defn part-2 [input]
  (let [reduced-polymer (reduce-polymer input)]
    (->> (set (map str/lower-case input))
         (map (fn [type]
                (let [modified-input (->> reduced-polymer
                                          (remove (fn [char]
                                                    (= type (str/lower-case char))))
                                          (str/join))]
                  (count (reduce-polymer modified-input)))))
         (sort)
         (first))))


